class Solution {
  int count(String num1, String num2, int min_sum, int max_sum) {
    final MOD = 1000000007;
    List<List<List<int>>> memo = List.generate(
        21,
        (_) => List.generate(
            403,
            (_) => List.generate(2, (_) => -1)));

    int dp(int n, int sum, int tight, String num) {
      if (n == 0) return sum >= min_sum && sum <= max_sum ? 1 : 0;
      if (sum > max_sum) return 0;
      if (memo[n][sum][tight] != -1) return memo[n][sum][tight];
      int limit = tight == 1 ? int.parse(num[num.length - n]) : 9;
      int ans = 0;
      for (int i = 0; i <= limit; i++) {
        ans = (ans + dp(n - 1, sum + i, tight == 1 && i == limit ? 1 : 0, num)) % MOD;
      }
      return memo[n][sum][tight] = ans;
    }

    int countInRange(String num) {
      return dp(num.length, 0, 1, num);
    }

    int toInt(String num) => int.parse(num);
    int num1Int = toInt(num1) - 1;
    int num2Int = toInt(num2);
    int ans1 = countInRange(num2Int.toString());
    int ans2 = num1Int > 0 ? countInRange(num1Int.toString()) : 0;
    return (ans1 - ans2 + MOD) % MOD;
  }
}
